void draw_bg()
{
    for (int k = 0; k < 153600; k += 2)
    {
        int red = ((flappy_bg[k + 1] & 0xF8) >> 3) << 11;
        int green = (((flappy_bg[k] & 0xE0) >> 5)) | ((flappy_bg[k + 1] & 0x7) << 3);
        int blue = (flappy_bg[k] & 0x1f);

        short int p = red | ((green << 5) | blue);
        plot_pixel((k / 2) % 320, (k / 2) / 320, p);
    }
}

